// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

contract MinimalProxyFactory {
    event ProxyDeployed(address proxy);

    // createClone 함수는 EIP-1167 방식으로 최소 Proxy를 생성
    function createClone(address implementation) external returns (address clone) {
        //로직 컨트랙트 주소를 20바이트로 슬라이스 (EVM 주소는 20바이트)
        bytes20 impl = bytes20(implementation);
        assembly {
            //EVM의 free memory pointer 위치를 가져옴 (메모리의 안전한 시작점)
            let ptr := mload(0x40)
            //Minimal Proxy의 첫 번째 바이트코드 10개를 메모리에 저장
            mstore(ptr, 0x3d602d80600a3d3981f3)
            //	로직 컨트랙트 주소를 그 뒤에 저장 (정확히 20바이트)
            mstore(add(ptr, 0x14), shl(0x60, impl))
            //Minimal Proxy 마지막 바이트코드 15개 저장
            mstore(add(ptr, 0x28), 0x5af43d82803e903d91602b57fd5bf3)
            clone := create(0, ptr, 0x37)
        }
        emit ProxyDeployed(clone);
        return clone; // ✅ 이걸 JS에서 받아야 해!
    }
}

